// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import './CryptoMartRegistry.sol';
import './CryptoMartCore.sol';
import './CryptoMartTransactions.sol';
import './CryptoMartStorage.sol';

/**
 * @title CryptoMart
 * @dev Main interface contract that proxies calls to the appropriate sub-contracts
 * This provides a unified interface for the frontend while using the registry pattern internally
 */
contract CryptoMart {

  CryptoMartRegistry public immutable registry;

  // --- Contract References (cached for gas efficiency) ---
  CryptoMartStorage public storageContract;
  CryptoMartCore public coreContract;
  CryptoMartTransactions public transactionsContract;

  // --- Events (re-emitted from sub-contracts for frontend compatibility) ---
  event ProductCreated(uint256 indexed productId, address indexed seller, string name, uint256 cost);
  event ProductUpdated(uint256 indexed productId);
  event ProductDeleted(uint256 indexed productId);
  event ProductPurchased(uint256 indexed productId, address indexed buyer, address indexed seller);
  event UserRegistered(address indexed user, string name);
  event SellerRegistered(address indexed seller, string businessName);
  event CategoryCreated(uint256 indexed categoryId, string name);
  event BalanceWithdrawn(address indexed seller, uint256 amount);
  event ReviewCreated(uint256 indexed productId, address indexed reviewer, uint256 rating);

  constructor(address _registry) {
    registry = CryptoMartRegistry(_registry);
    _updateContractReferences();
  }

  /**
   * @dev Update contract references from registry
   * Call this after any contract upgrades
   */
  function _updateContractReferences() internal {
    (address storage_, address core, address transactions) = registry.getContractAddresses();

    storageContract = CryptoMartStorage(payable(storage_));
    coreContract = CryptoMartCore(payable(core));
    transactionsContract = CryptoMartTransactions(payable(transactions));
  }

  /**
   * @dev Manually refresh contract references (in case of upgrades)
   */
  function refreshContractReferences() external {
    _updateContractReferences();
  }

  // ===========================================
  // USER FUNCTIONS (delegated to Core contract)
  // ===========================================

  function registerUser(string memory name, string memory email, string memory avatar) external {
    coreContract.registerUser(name, email, avatar);
    emit UserRegistered(msg.sender, name);
  }

  function getUser(address user) external view returns (CryptoMartStorage.UserProfile memory) {
    return coreContract.getUser(user);
  }

  // ===========================================
  // SELLER FUNCTIONS (delegated to Core contract)
  // ===========================================

  function registerSeller(
    string memory businessName,
    string memory description,
    string memory email,
    string memory phone,
    string memory logo
  ) external {
    coreContract.registerSeller(businessName, description, email, phone, logo);
    emit SellerRegistered(msg.sender, businessName);
  }

  function getSeller(address seller) external view returns (
    CryptoMartStorage.SellerProfile memory,
    CryptoMartStorage.SellerStatus
  ) {
    return coreContract.getSeller(seller);
  }

  function getSellerProfile(address seller) external view returns (CryptoMartStorage.SellerProfile memory) {
    return coreContract.getSellerProfile(seller);
  }

  function getAllSellers() external view returns (address[] memory) {
    return coreContract.getAllSellers();
  }

  function getAllRegisteredSellers() external view returns (address[] memory) {
    return coreContract.getAllRegisteredSellers();
  }

  function getPendingVerificationUsers() external view returns (address[] memory) {
    return coreContract.getPendingVerificationUsers();
  }

  function getSellerStatus(address seller) external view returns (CryptoMartStorage.SellerStatus) {
    return coreContract.getSellerStatus(seller);
  }

  // ===========================================
  // CATEGORY FUNCTIONS (delegated to Core contract)
  // ===========================================

  function createCategory(string memory name) external {
    coreContract.createCategory(name);
    // Note: Event is emitted by Core contract
  }

  function getAllCategories() external view returns (CryptoMartStorage.CategoryStruct[] memory) {
    return coreContract.getAllCategories();
  }

  function getCategory(uint256 id) external view returns (uint256, string memory, bool, uint256[] memory) {
    return coreContract.getCategory(id);
  }

  function updateCategory(uint256 id, string memory name, bool isActive) external {
    coreContract.updateCategory(id, name, isActive);
  }

  function deleteCategory(uint256 id) external {
    coreContract.deleteCategory(id);
  }

  // ===========================================
  // PRODUCT FUNCTIONS (delegated to Core contract)
  // ===========================================

  function createProduct(
    string memory name,
    string memory description,
    string memory image,
    uint256 categoryId,
    uint256 cost,
    uint256 stock
  ) external {
    coreContract.createProduct(name, description, image, categoryId, cost, stock);
    // Note: Event is emitted by Core contract
  }

  function getProduct(uint256 productId) external view returns (CryptoMartStorage.ProductStruct memory) {
    return coreContract.getProduct(productId);
  }

  function getAllProducts() external view returns (CryptoMartStorage.ProductStruct[] memory) {
    return coreContract.getAllProducts();
  }

  function getMyProducts() external view returns (CryptoMartStorage.ProductStruct[] memory) {
    return coreContract.getMyProducts();
  }

  function getSellerProducts(address seller) external view returns (CryptoMartStorage.ProductStruct[] memory) {
    return coreContract.getSellerProducts(seller);
  }

  // ===========================================
  // TRANSACTION FUNCTIONS (delegated to Transactions contract)
  // ===========================================

  function buyProduct(uint256 productId) external payable {
    transactionsContract.buyProduct{value: msg.value}(productId);
    // Note: Events are emitted by Transactions contract
  }

  function getBuyerPurchaseHistory(address buyer) external view returns (CryptoMartStorage.PurchaseStruct[] memory) {
    return transactionsContract.getBuyerPurchaseHistory(buyer);
  }

  function getSellerPurchaseHistory(address seller) external view returns (CryptoMartStorage.PurchaseStruct[] memory) {
    return transactionsContract.getSellerPurchaseHistory(seller);
  }

  function markPurchaseDelivered(uint256 productId, address buyer) external {
    transactionsContract.markPurchaseDelivered(productId, buyer);
  }

  function withdraw() external {
    transactionsContract.withdraw();
  }

  function getSellerBalance(address seller) external view returns (uint256) {
    return transactionsContract.getSellerBalance(seller);
  }

  // ===========================================
  // REVIEW FUNCTIONS (delegated to Transactions contract)  
  // ===========================================

  function createReview(uint256 productId, uint256 rating, string memory comment) external {
    transactionsContract.createReview(productId, rating, comment);
  }

  function getReviews(uint256 productId) external view returns (CryptoMartStorage.ReviewStruct[] memory) {
    return transactionsContract.getReviews(productId);
  }

  function deleteReview(uint256 productId, uint256 reviewId) external {
    transactionsContract.deleteReview(productId, reviewId);
  }

  // ===========================================
  // ADMIN FUNCTIONS (delegated to Storage)
  // ===========================================

  function changeServicePct(uint256 newPct) external {
    storageContract.setServicePct(newPct);
  }

  function withdrawServiceFees() external {
    storageContract.withdrawServiceFees();
  }

  // ===========================================
  // COMPATIBILITY FUNCTIONS (for existing frontend)
  // ===========================================

  // These functions maintain compatibility with the existing frontend code

  function registeredUsers(address user) external view returns (bool) {
    return storageContract.registeredUsers(user);
  }

  function registeredSellers(address seller) external view returns (bool) {
    return storageContract.registeredSellers(seller);
  }

  function servicePct() external view returns (uint256) {
    return storageContract.servicePct();
  }

  function getTotalProducts() external view returns (uint256) {
    return coreContract.getTotalProducts();
  }

  function getTotalSales() external view returns (uint256) {
    return coreContract.getTotalSales();
  }

  function owner() external view returns (address) {
    return registry.owner();
  }

  // Stub functions for subcategory compatibility (simplified)
  function createSubCategory(uint256 /*parentId*/, string memory name) external {
    coreContract.createCategory(name);
  }

  function createSubCategoriesBulk(uint256 /*parentId*/, string[] memory names) external {
    for (uint256 i = 0; i < names.length; i++) {
      coreContract.createCategory(names[i]);
    }
  }

  function getSubCategories(uint256 /*categoryId*/) external pure returns (uint256[] memory) {
    return new uint256[](0);
  }

  function updateSubCategory(uint256 id, string memory name, bool isActive) external {
    coreContract.updateCategory(id, name, isActive);
  }

  function getSubCategory(uint256 id) external view returns (uint256, string memory, uint256, bool) {
    (uint256 catId, string memory name, bool isActive, ) = coreContract.getCategory(id);
    return (catId, name, 0, isActive);
  }

  function deleteSubCategory(uint256 id) external {
    coreContract.deleteCategory(id);
  }

  function updateSellerStatus(address seller, CryptoMartStorage.SellerStatus status) external {
    coreContract.updateSellerStatus(seller, status);
  }

  function grantOwnerSellerAccess() external {
    coreContract.grantOwnerSellerAccess();
  }

  // Additional compatibility functions that might be needed
  function updateProduct(
    uint256 productId,
    string memory name,
    string memory description,
    string memory image,
    uint256 categoryId,
    uint256 cost,
    uint256 stock
  ) external {
    coreContract.updateProduct(productId, name, description, image, categoryId, cost, stock);
    emit ProductUpdated(productId);
  }

  function deleteProduct(uint256 productId) external {
    coreContract.deleteProduct(productId);
    emit ProductDeleted(productId);
  }

  function getProductsByCategory(uint256 categoryId) external view returns (CryptoMartStorage.ProductStruct[] memory) {
    // Get all products and filter by category
    CryptoMartStorage.ProductStruct[] memory allProducts = coreContract.getAllProducts();

    // Count products in category first
    uint256 count = 0;
    for (uint256 i = 0; i < allProducts.length; i++) {
      if (allProducts[i].categoryId == categoryId) {
        count++;
      }
    }

    // Create result array
    CryptoMartStorage.ProductStruct[] memory categoryProducts = new CryptoMartStorage.ProductStruct[](count);
    uint256 index = 0;

    for (uint256 i = 0; i < allProducts.length; i++) {
      if (allProducts[i].categoryId == categoryId) {
        categoryProducts[index] = allProducts[i];
        index++;
      }
    }

    return categoryProducts;
  }

  // ===========================================
  // REGISTRY FUNCTIONS
  // ===========================================

  function getRegistryInfo() external view returns (
    address registryAddress,
    bool isConfigured,
    uint256 deploymentTime,
    string memory version
  ) {
    return (
      address(registry),
      registry.isConfigured(),
      registry.deploymentTimestamp(),
      "Registry v1.0.0"
    );
  }

  function getSystemStats() external view returns (
    uint256 totalProducts,
    uint256 totalSales,
    uint256 totalCategories,
    uint256 serviceFee
  ) {
    return (
      coreContract.getTotalProducts(),
      coreContract.getTotalSales(),
      0, // totalCategories - would need to be implemented
      storageContract.servicePct()
    );
  }
}

contracts/CryptoMartRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import '@openzeppelin/contracts/access/Ownable.sol';

/**
 * @title CryptoMartRegistry
 * @dev Lightweight registry that tracks deployed contract addresses
 * This replaces the heavy Factory pattern with a simple registry approach
 */
contract CryptoMartRegistry is Ownable {

  // --- Contract Addresses ---
  address public storageContract;
  address public coreContract;
  address public transactionsContract;

  // --- Deployment State ---
  bool public isConfigured = false;
  uint256 public deploymentTimestamp;

  // --- Events ---
  event SystemConfigured(
    address indexed storage_,
    address indexed core,
    address indexed transactions,
    uint256 timestamp
  );

  constructor() {
    // Registry is owned by deployer
  }

  /**
   * @dev Configure the system with deployed contract addresses
   * @param _storage Address of deployed CryptoMartStorage
   * @param _core Address of deployed CryptoMartCore
   * @param _transactions Address of deployed CryptoMartTransactions
   */
  function configureSystem(
    address _storage,
    address _core,
    address _transactions
  ) external onlyOwner {
    require(!isConfigured, "System already configured");
    require(_storage != address(0), "Invalid storage address");
    require(_core != address(0), "Invalid core address");
    require(_transactions != address(0), "Invalid transactions address");

    storageContract = _storage;
    coreContract = _core;
    transactionsContract = _transactions;

    isConfigured = true;
    deploymentTimestamp = block.timestamp;

    emit SystemConfigured(_storage, _core, _transactions, block.timestamp);
  }

  /**
   * @dev Get all contract addresses
   * @return storage_ Storage contract address
   * @return core Core contract address  
   * @return transactions Transactions contract address
   */
  function getContractAddresses() external view returns (
    address storage_,
    address core,
    address transactions
  ) {
    require(isConfigured, "System not configured");
    return (storageContract, coreContract, transactionsContract);
  }

  /**
   * @dev Update a contract address (for upgrades)
   * @param contractType Type of contract (0=storage, 1=core, 2=transactions)
   * @param newAddress New contract address
   */
  function updateContract(uint8 contractType, address newAddress) external onlyOwner {
    require(isConfigured, "System not configured");
    require(newAddress != address(0), "Invalid address");

    address oldAddress;

    if (contractType == 0) {
      oldAddress = storageContract;
      storageContract = newAddress;
    } else if (contractType == 1) {
      oldAddress = coreContract;
      coreContract = newAddress;
    } else if (contractType == 2) {
      oldAddress = transactionsContract;
      transactionsContract = newAddress;
    } else {
      revert("Invalid contract type");
    }

    emit ContractUpgraded(contractType, oldAddress, newAddress);
  }

  event ContractUpgraded(uint8 contractType, address oldAddress, address newAddress);
}

contracts/CryptoMartStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import '@openzeppelin/contracts/access/Ownable.sol';

/**
 * @title CryptoMartStorage
 * @dev Storage contract that holds all the data for CryptoMart
 * This separates storage from logic to reduce contract size
 */
contract CryptoMartStorage is Ownable {

  // --- Core Counters ---
  uint256 public totalProducts;
  uint256 public totalSales;
  uint256 public totalReviews;
  uint256 public categoryCounter;
  uint256 public servicePct;

  // --- Enums ---
  enum SellerStatus { Unverified, Pending, Verified, Suspended }

  // --- Structs ---
  struct ProductStruct {
    uint256 id;
    address seller;
    string name;
    string description;
    string image;
    uint256 categoryId;
    uint256 cost;
    uint256 stock;
    uint256 timestamp;
    bool deleted;
  }

  struct UserProfile {
    string name;
    string email;
    string avatar;
    bool isRegistered;
  }

  struct SellerProfile {
    string businessName;
    string description;
    string email;
    string phone;
    string logo;
    bool isRegistered;
    uint256 registeredAt;
  }

  struct CategoryStruct {
    uint256 id;
    string name;
    bool isActive;
  }

  struct PurchaseStruct {
    uint256 productId;
    address buyer;
    address seller;
    uint256 totalAmount;
    uint256 timestamp;
    bool isDelivered;
  }

  struct ReviewStruct {
    uint256 reviewId;
    address reviewer;
    uint256 rating;
    string comment;
    bool deleted;
    uint256 timestamp;
  }

  // --- Core Mappings ---
  mapping(uint256 => ProductStruct) public products;
  mapping(address => uint256[]) public sellerProducts;
  mapping(uint256 => bool) public productExists;
  mapping(address => UserProfile) public userProfiles;
  mapping(address => bool) public registeredUsers;
  mapping(address => SellerProfile) public sellerProfiles;
  mapping(address => bool) public registeredSellers;
  mapping(address => SellerStatus) public sellerStatus;
  mapping(address => uint256) public sellerBalances;
  mapping(uint256 => CategoryStruct) public categories;
  mapping(address => PurchaseStruct[]) public buyerPurchaseHistory;
  mapping(address => PurchaseStruct[]) public sellerPurchaseHistory;
  mapping(uint256 => ReviewStruct[]) public productReviews;
  mapping(uint256 => uint256) public productCategories;

  // --- Lists ---
  address[] public registeredSellersList;
  address[] public usersList;
  address[] public pendingVerificationUsers;

  // --- Access Control ---
  mapping(address => bool) public authorizedContracts;

  modifier onlyAuthorized() {
    require(authorizedContracts[msg.sender] || msg.sender == owner(), "Not authorized");
    _;
  }

  constructor(uint256 _servicePct) {
    servicePct = _servicePct;
    authorizedContracts[msg.sender] = true; // Factory is authorized
  }

  // --- Authorization Functions ---
  function addAuthorizedContract(address _contract) external onlyOwner {
    authorizedContracts[_contract] = true;
  }

  function removeAuthorizedContract(address _contract) external onlyOwner {
    authorizedContracts[_contract] = false;
  }

  // --- Counter Functions ---
  function incrementProducts() external onlyAuthorized returns (uint256) {
    totalProducts++;
    return totalProducts;
  }

  function incrementSales() external onlyAuthorized returns (uint256) {
    totalSales++;
    return totalSales;
  }

  function incrementReviews() external onlyAuthorized returns (uint256) {
    totalReviews++;
    return totalReviews;
  }

  function incrementCategories() external onlyAuthorized returns (uint256) {
    categoryCounter++;
    return categoryCounter;
  }

  // --- Data Modification Functions ---
  function setProduct(uint256 id, ProductStruct memory product) external onlyAuthorized {
    products[id] = product;
    productExists[id] = true;
  }

  function addSellerProduct(address seller, uint256 productId) external onlyAuthorized {
    sellerProducts[seller].push(productId);
  }

  function setUser(address user, UserProfile memory profile) external onlyAuthorized {
    userProfiles[user] = profile;
    if (!registeredUsers[user]) {
      registeredUsers[user] = true;
      usersList.push(user);
    }
  }

  function setSeller(address seller, SellerProfile memory profile) external onlyAuthorized {
    sellerProfiles[seller] = profile;
    if (!registeredSellers[seller]) {
      registeredSellers[seller] = true;
      registeredSellersList.push(seller);
    }
  }

  function setSellerStatus(address seller, SellerStatus status) external onlyAuthorized {
    sellerStatus[seller] = status;

    // Add to pending if needed
    if (status == SellerStatus.Pending) {
      pendingVerificationUsers.push(seller);
    }

    // Remove from pending if verified
    if (status == SellerStatus.Verified) {
      for (uint256 i = 0; i < pendingVerificationUsers.length; i++) {
        if (pendingVerificationUsers[i] == seller) {
          pendingVerificationUsers[i] = pendingVerificationUsers[pendingVerificationUsers.length - 1];
          pendingVerificationUsers.pop();
          break;
        }
      }
    }
  }

  function updateSellerBalance(address seller, uint256 amount) external onlyAuthorized {
    sellerBalances[seller] += amount;
  }

  function deductSellerBalance(address seller, uint256 amount) external onlyAuthorized {
    require(sellerBalances[seller] >= amount, "Insufficient balance");
    sellerBalances[seller] -= amount;
  }

  function setCategory(uint256 id, CategoryStruct memory category) external onlyAuthorized {
    categories[id] = category;
  }

  function addPurchaseHistory(address buyer, address seller, PurchaseStruct memory purchase) external onlyAuthorized {
    buyerPurchaseHistory[buyer].push(purchase);
    sellerPurchaseHistory[seller].push(purchase);
  }

  function addReview(uint256 productId, ReviewStruct memory review) external onlyAuthorized {
    productReviews[productId].push(review);
  }

  function setProductCategory(uint256 productId, uint256 categoryId) external onlyAuthorized {
    productCategories[productId] = categoryId;
  }

  function setServicePct(uint256 _servicePct) external onlyAuthorized {
    servicePct = _servicePct;
  }

  // --- View Functions ---
  function getProduct(uint256 id) external view returns (ProductStruct memory) {
    return products[id];
  }

  function getSellerProducts(address seller) external view returns (uint256[] memory) {
    return sellerProducts[seller];
  }

  function getUser(address user) external view returns (UserProfile memory) {
    return userProfiles[user];
  }

  function getSeller(address seller) external view returns (SellerProfile memory, SellerStatus) {
    return (sellerProfiles[seller], sellerStatus[seller]);
  }

  function getCategory(uint256 id) external view returns (CategoryStruct memory) {
    return categories[id];
  }

  function getBuyerPurchases(address buyer) external view returns (PurchaseStruct[] memory) {
    return buyerPurchaseHistory[buyer];
  }

  function getSellerPurchases(address seller) external view returns (PurchaseStruct[] memory) {
    return sellerPurchaseHistory[seller];
  }

  function getProductReviews(uint256 productId) external view returns (ReviewStruct[] memory) {
    return productReviews[productId];
  }

  function getAllRegisteredSellers() external view returns (address[] memory) {
    return registeredSellersList;
  }

  function getPendingVerificationUsers() external view returns (address[] memory) {
    return pendingVerificationUsers;
  }

  // --- Service Fee Management ---
  function withdrawServiceFees() external onlyOwner {
    uint256 balance = address(this).balance;
    require(balance > 0, 'No fees to withdraw');

    (bool success, ) = payable(owner()).call{value: balance}('');
    require(success, 'Fee withdrawal failed');
  }

  // --- Receive ETH for service fees ---
  receive() external payable {}
}

